class App extends React.Component {

   state = {
       list:[],
       searchTerm:'',
   } 






   componentDidMount(){

       const selectedCountry = this.state.selectedCountry;
           //API request from country rest full apis
    fetch(`https://restcountries.eu/rest/v2/alpha/${selectedCountry}`)
       .then(res => res.json())
       .then(json => {
           this.setState ({
               list:json,

           })


       })
   }







    render () {

        return (

            <div className="App">


                   <form>
                       <input type="text" onChange={this.onSearchChange}></input>
                   </form>


                    <div></div>





            </div>
        )
    }

}

export default App;
